(line: Message): CellHandler => {
    const attributes = line.json_content["Attributes"];
    if (attributes == null) {
        return {
            text: "<no attributes found>"
        }
    }
    const headers = attributes.map(attr => attr.Key);
    const values = attributes.map(attr => attr.Value.Value);

    const headerHtml = headers.map(header => `<th>${header}</th>`).join('');
    const rowHtml = values.map(value => `<td>${value}</td>`).join('');

    return {
        allowHtmlInText: true,
        text: `<table>
             <tr>${headerHtml}</tr>
             <tr>${rowHtml}</tr>
           </table>`,
    };

}

